import Head from 'next/head';
import Layout from '../components/layout'

const contact = () => {
    return (
        <Layout title="contact">
             <Head>
                <title>Contact</title>
            </Head>
            <div>
                <h1>Contact</h1>
            </div>
        </Layout>
    );
};

export default contact;
